post_text:
Camp Wow is now open!

Pasco County Schools’ summer camp program is now open at 14 school sites around the county. The popular summer camp program is available Monday through Friday from 6:30 a.m. to 6:00 p.m. with several health and safety modifications in place, including:
• Reduced staff to student ratios;
• Enhanced sanitizing procedures;
• Curbside dropoff and pickup;
• Daily health screenings

To register for summer camp, to see a list of sites, or to learn more about the program, visit the Camp Wow! web page at https://myasep.com/campwow/

